import React from "react";
import {Button, Form, FormGroup, FormLabel, InputGroup} from "react-bootstrap";

export const Signup = () => {
    return (
        <Form>
            <h1>Company Services</h1>
            <h2>Welcome</h2>
            <FormGroup>
                <FormLabel>
                    E-mail
                </FormLabel>
                <InputGroup type="email" placeholder="E-mail"/>

            </FormGroup>
        </Form>
    )
}
